import React, { Component } from "react";
import App from "./App";

class Button extends React.Component {
  render() {
    return (
      <div className="MainDiv">
       <div>
           <label className = "Label"> CALCULATOR </label>
       </div>
       <div>
           <input type="text" > INPUT </input>
       </div>

        
      </div>
    );
  }
}

export default Button;
